function handleWelcome(event){
	const element = document.createElement('div');
    element.setAttribute('class', 'customClass');
    element.innerHTML = "
Hi!";
    event.data.element.appendChild(element);
}

function customResponseHandler(event) {
    const { message } = event.data;
    
    switch (message.user_defined.template_name) {
      case 'welcome':
        handleWelcome(event);
        break;
      default:
        console.error('Unhandled response type.');
    }
}

function nsToast() {
	if($(".WACLauncherComplex__Text").length){
		if($(".WACLauncherComplex__Text").text() == "Welcome to NeuralSeek"){
			$(".WACLauncherComplex__Text").html("Hey! Ask me a question and see NeuralSeek in action ");
			console.log("set it");
		}
		else
			setTimeout(function() { nsToast()}, 100);
	}
	else
		setTimeout(function() { nsToast()},100);
}

window.watsonAssistantChatOptions = {
    integrationID: "c22884d5-ae86-4e1c-81a0-f6b7d7cc6561", 
    region: "us-south", 
    serviceInstanceID: "e9269e17-5fa9-491f-b57b-c2837d9cc744", 
    onLoad: function(instance) { 
		instance.showLauncherGreetingMessage(1000);
		instance.on({ type: 'customResponse', handler: customResponseHandler });
		instance.render(); 
		setTimeout(function() { nsToast()}, 100);
	}
  };
  setTimeout(function(){
    const t=document.createElement('script');
    t.src="https://web-chat.global.assistant.watson.appdomain.cloud/versions/" + (window.watsonAssistantChatOptions.clientVersion || 'latest') + "/WatsonAssistantChatEntry.js";
    document.head.appendChild(t);
  });
